import React from 'react';
import {
    withScriptjs,
    withGoogleMap,
    GoogleMap,
    Marker,
  } from "react-google-maps";

function MapInit(){
    const MapWithAMarker = withScriptjs(withGoogleMap(props =>
        <GoogleMap
          defaultZoom={3}
          defaultCenter={{ lat: 13.845903076407293, lng: 100.56659399251618 }}
        >
          <Marker
            position={{ lat: -40.397, lng: 150.644 }}
          />
        </GoogleMap>
      ));
    
      return(
        <MapWithAMarker
          googleMapURL="https://maps.googleapis.com/maps/api/js?key=AIzaSyDmK5n48lyPTTnG3RgONpyDW3IpaygueZ4&v=3.exp&libraries=geometry,drawing,places"
          loadingElement={<div style={{ height: `100%` }} />}
          containerElement={<div style={{ height: `600px` }} />}
          mapElement={<div style={{ height: `100%` }} />}
        />
      );
}

export default MapInit;
